import React, {Component, Fragment} from "react";
import {withRouter} from "react-router";

class register extends Component {
    constructor() {
        super();
        this.state = {}
    }
  add=()=>{
        this.props.history.go(-1)
  }
    render() {
        return (<Fragment>
            <div className={"register"}>
             <div className={"one"}>

             </div>
                <div className={"one"}>

                </div>
                <div className={"one"}>

                </div>
                </div>
        </Fragment>)
    }

}

export default withRouter(register);
